@import url('https://fonts.googleapis.com/css2?family=Comic+Neue:wght@400;700&display=swap');
*{
    margin: 0;
    box-sizing: border-box;
    &:before,&:after{
        box-sizing: border-box;
    }
}

html,body{
    overflow-x: hidden;
}

body{
    font-family: "Poppins", sans-serif;
    line-height: 1.5;
    -webkit-font-smoothing: antialiased;
    height: 100vh;
}

button,input,textarea,select{
    font: inherit;
}

p,h1,h2,h3,h4,h5,h6{
    overflow-wrap: break-word;
}

img,video,canvas,svg{
    max-width: 100%;
}

a{
    text-decoration: none;
    color: inherit;
}
ul{
    list-style: none;
}

/*----Variable----*/
$green-color: #6cff8d;
$dark-green-color: #6cff8c7a;
$darkish-blue: #0b1623;
$box-shadow-blue1: #0f141f;
$box-shadow-blue2: #0a1123;

/*----predefined classes----*/
.section{
    padding: 1rem;
    overflow: hidden;
    min-height: 100vh;
    padding-top: 5rem;
    @media (min-width: 650px){
        padding: 5rem;
    }
    &__header{
        &-title{
            font-weight: 400;
            font-size: 18px;
            color: #28292a;
        }
        &-subtitle{
            font-weight: 700;
            font-size: 24px;
            color: #28292a;
        }
    }
}
